La razón es que este poema está escrito por José Rizal, el reconocido escritor, poeta, y héroe nacional de Filipinas, quien vivió en el siglo XIX (1861-1896). El poema tiene referencias a lugares y nombres filipinos como Laong-Laan, San Nicolás, Sampalok y el volcán Taal, que son característicos de su obra poética.
